import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
      <div className="container">
        <div className="row p-2">
          <div className="col-3 bg-secondary">
            <h1 className='text-primary'><i class="bi bi-twitter"></i></h1>
          </div>
          <div className="col-6 bg-success d-flex align-items-center">
            <h5>Home</h5>
          </div>
          <div className="col-3 d-flex align-items-center">
            <input type="text" placeholder='Search Twitter'
            className='rounded-4 border border-0 bg-secondary-subtle px-3 py-1'/>
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
